categoyURLs = new WebResource(URL.codeBase.withFilename('PartsBin/'))
    .getSubElements().subCollections.invoke('getURL');
categoyURLs.doAndContinue(function(next, url) {
    category = url.relativePathFrom(URL.codeBase);
    partsSpace = lively.PartsBin.partsSpaceNamed(category);
    partsSpace.load();
    partItems = partsSpace.getPartItems();
    partItems.forEachShowingProgress(
        this.get('ProgressBar'),
        function(partItem) {
            var part = partItem.loadPart().part;
            part.openInWorld();
            var serialized = partItem.serializePart(part);
            part.remove();
            new WebResource(partItem.getHTMLLogoURL()).put(serialized.htmlLogo);
        },
        function(partItem) { return partItem.name },
        function(partItem) { next(); alertOK('Done') });
}, null, this);

